import React from 'react';
import './ItemInfo.css';

function Supply(props) {
    const item = props.item
    return (
        <div class = 'dem_or_sup'>
            '가져가세요!'
            <div class = 'price'>
                {item.price}
            </div>
        </div>
    );
}

export default Supply;
